import {Injectable} from '@angular/core';
import TravelItem from '../../shared/model/TravelItem';
import {Observable, of} from 'rxjs';
import Photo from '../../shared/model/Photo';

@Injectable({
    providedIn: 'root',
})
export default class TravelsService {
    travelItems: TravelItem[] = [];

    constructor() {
        const photoSpain1 = new Photo('data:image/jpeg;base64,', 'spain');
        const photoSpain2 = new Photo('data:image/jpeg;base64,', 'spain2');
        const photoSweden = new Photo('data:image/jpeg;base64,', 'sweden');
        const firstTravelItem = new TravelItem('Spain', '', 1, [photoSpain1, photoSpain2] );
        const secondTravelItem = new TravelItem('Sweden', '', 2, [photoSweden]);
        this.travelItems.push(firstTravelItem, secondTravelItem);
    }

    getTravelsItems(): Observable<TravelItem[]> {
        return of(this.travelItems);
    }

    addTravelItem(travelItem: TravelItem) {
        this.travelItems.push(travelItem);
    }
}
